// Traemos pokemones a nuestro pokedex
export const getPokemons = async () => {
  try {
    let url = "https://pokeapi.co/api/v2/pokemon?limit=6&offset=6";
    const response = await fetch(url);
    const data = await response.json();
    return data;
  } catch (error) {
    console.log(error);
  }
};
